Raft nodes need to communicate with each other to achieve consensus about the logs. The trait RaftNetwork defines the data transmission requirements. An implementation of RaftNetwork can be considered as a wrapper that invokes the corresponding methods of a remote Raft. pub trait RaftNetwork<D>: Send + Sync + 'static
where D: AppData
{ async fn send_append_entries(&self, target: NodeId, node:Option<Node>, rpc: AppendEntriesRequest<D>) -> Result<AppendEntriesResponse>; async fn send_install_snapshot( &self, target: NodeId, node:Option<Node>, rpc: InstallSnapshotRequest,) -> Result<InstallSnapshotResponse>; async fn send_vote(&self, target: NodeId, node:Option<Node>, rpc: VoteRequest) -> Result<VoteResponse>;
} ExampleNetwork shows how to forward messages to other raft nodes. And there should be a server endpoint for each of these RPCs. When the server receives a raft RPC, it just passes it to its raft instance and replies with what returned: raft-server-endpoint . As a real-world impl, you may want to use Tonic gRPC . databend-meta would be an excellent real-world example.

