An implementation of RaftNetwork need to connect to the remote raft peer, through TCP etc. You have two ways to find the address of a remote peer: Managing the mapping from node-id to address by yourself. openraft allows you to store the additional info in its internal Membership, which is automatically replicated as regular logs. To use this feature, you need to pass a Node instance, which contains address and other info, to Raft::add_learner(): Raft::add_learner(node_id, None, ...) tells openraft to store only node-id in Membership. The membership data then would be like: "membership": { "learners": [], "configs": [ [ 1, 2, 3 ] ], "nodes": {}
} Raft::add_learner(node_id, Some(Node::new("127.0.0.1")), ...) tells openraft to store node-id, and its address in Membership too: "membership": { "learners": [], "configs": [ [ 1, 2, 3 ] ], "nodes": { "1": { "addr": "127.0.0.1:21001", "data": {} }, "2": { "addr": "127.0.0.1:21002", "data": {} }, "3": { "addr": "127.0.0.1:21003", "data": {} } }
}

