`---------> RaftCore -------------+-> Replication -. ^ ^ | | | | `-> Replication -+ | | | | `-----------------------------------' | update replication state; | need snapshot; | | | snapshot is ready; | Build-snapshot User to RaftCore: Raft sends RaftMsg though Raft.tx_api to RaftCore, along with a channel for RaftCore to send back response. RaftCore to Replication: RaftCore stores a channel for every repliation task. The messages sent to replication task includes: a new log id to replicate, and the index the leader has committed. Replication to RaftCore: Replication task sends the already replicated log id to RaftCore through another per-replication channel. Replication task sends a NeedSnapshot request through the same channel to ask RaftCore to build a snapshot if there is no log a follower/learner needs. Build-snapshot to RaftCore: RaftCore spawn a separate task to build a snapshot asynchronously. When finished, the spawned task sends to RaftCore a message including the snapshot info.

