One of the mistakes is to delete all entries after prev_log_id when a matching prev_log_id is found, e.g.: fn handle_append_entries(req) { if store.has(req.prev_log_id) { store.delete_logs(req.prev_log_id.index..) store.append_logs(req.entries) }
} This results in loss of committed entry, because deleting and appending are not atomically executed. E.g., the log entries are as following and R1 now is the leader: R1 1,1 1,2 1,3
R2 1,1 1,2
R3 When the following steps take place, committed entry {1,2} is lost: R1 to R2: append_entries(entries=[{1,2}, {1,3}], prev_log_id={1,1}) R2 deletes {1,2} R2 crash R2 elected as leader and only see {1,1}; the committed entry {1,2} is lost. The safe way is to skip every entry that present in append-entries message then delete only the inconsistent entries .

