A request is some data that modifies the raft state machine. A response is some data that the raft state machine returns to the client. Request and response can be any types that impl AppData and AppDataResponse, e.g.: #[derive(Clone, Debug, Serialize, Deserialize)]
pub struct ExampleRequest {/* fields */}
impl AppData for ExampleRequest {} #[derive(Clone, Debug, Serialize, Deserialize)]
pub struct ExampleResponse(Result<Option<String>, ClientError>);
impl AppDataResponse for ExampleResponse {} These two types are totally application-specific and are mainly related to the state machine implementation in RaftStorage.

